import React from 'react';
import './Clothing.css';

const Clothing = () => {
  return (
    <div className="clothing">
      <div className="depop-widget" data-username="sniffyscloset" data-width="300"></div>
      <script defer="defer" src="http://assets0.depop.com/widget.js"></script>
      <noscript><a href="http://depop.com">Depop</a></noscript>
      <div className="clothing-list">
        <div className="clothing-item">
          <h2>Item 1</h2>
          <p>Description of clothing item 1.</p>
        </div>
        <div className="clothing-item">
          <h2>Item 2</h2>
          <p>Description of clothing item 2.</p>
        </div>
        <div className="clothing-item">
          <h2>Item 3</h2>
          <p>Description of clothing item 3.</p>
        </div>
      </div>
    </div>
  );
};

export default Clothing;
